        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let background = UIColor(red: 0.000, green: 0.737, blue: 0.478, alpha: 1.000)


        //// Subframes
        let addInterestButton: CGRect = CGRectMake(frame.minX + floor(frame.width * 0.12533 + 0.5), frame.minY + floor(frame.height * 0.63118 + 0.5), floor(frame.width * 0.85600 + 0.5) - floor(frame.width * 0.12533 + 0.5), floor(frame.height * 0.71664 + 0.5) - floor(frame.height * 0.63118 + 0.5))
        let interestField: CGRect = CGRectMake(frame.minX + floor(frame.width * 0.12267 + 0.5), frame.minY + floor(frame.height * 0.34633 + 0.5), floor(frame.width * 0.85333 + 0.5) - floor(frame.width * 0.12267 + 0.5), floor(frame.height * 0.43178 + 0.5) - floor(frame.height * 0.34633 + 0.5))


        //// Add Interest Label Drawing
        let addInterestLabelRect = CGRectMake(frame.minX + floor((frame.width - 250) * 0.50400 + 0.5), frame.minY + floor((frame.height - 70) * 0.15075 + 0.5), 250, 70)
        var addInterestLabelTextContent = NSString(string: "Add Interest")
        let addInterestLabelStyle = NSMutableParagraphStyle.defaultParagraphStyle().mutableCopy() as! NSMutableParagraphStyle
        addInterestLabelStyle.alignment = NSTextAlignment.Center

        let addInterestLabelFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(45), NSForegroundColorAttributeName: UIColor.whiteColor(), NSParagraphStyleAttributeName: addInterestLabelStyle]

        let addInterestLabelTextHeight: CGFloat = addInterestLabelTextContent.boundingRectWithSize(CGSizeMake(addInterestLabelRect.width, CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: addInterestLabelFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, addInterestLabelRect);
        addInterestLabelTextContent.drawInRect(CGRectMake(addInterestLabelRect.minX, addInterestLabelRect.minY + (addInterestLabelRect.height - addInterestLabelTextHeight) / 2, addInterestLabelRect.width, addInterestLabelTextHeight), withAttributes: addInterestLabelFontAttributes)
        CGContextRestoreGState(context)


        //// AddInterest Button
        //// Rectangle 2 Drawing
        let rectangle2Path = UIBezierPath(roundedRect: CGRectMake(addInterestButton.minX + floor(addInterestButton.width * 0.00000 + 0.5), addInterestButton.minY + floor(addInterestButton.height * 0.00000 + 0.5), floor(addInterestButton.width * 1.00000 + 0.5) - floor(addInterestButton.width * 0.00000 + 0.5), floor(addInterestButton.height * 1.00000 + 0.5) - floor(addInterestButton.height * 0.00000 + 0.5)), cornerRadius: 5)
        UIColor.whiteColor().setFill()
        rectangle2Path.fill()




        //// InterestField
        //// Rectangle 8 Drawing
        let rectangle8Path = UIBezierPath(roundedRect: CGRectMake(interestField.minX + floor(interestField.width * 0.00000 + 0.5), interestField.minY + floor(interestField.height * 0.00000 + 0.5), floor(interestField.width * 1.00000 + 0.5) - floor(interestField.width * 0.00000 + 0.5), floor(interestField.height * 1.00000 + 0.5) - floor(interestField.height * 0.00000 + 0.5)), cornerRadius: 5)
        UIColor.whiteColor().setFill()
        rectangle8Path.fill()


        //// Rectangle 9 Drawing
        let rectangle9Path = UIBezierPath(roundedRect: CGRectMake(interestField.minX + floor(interestField.width * 0.03285 + 0.5), interestField.minY + floor(interestField.height * 0.12281 + 0.5), floor(interestField.width * 0.18066) - floor(interestField.width * 0.03285 + 0.5) + 0.5, floor(interestField.height * 0.85965 + 0.5) - floor(interestField.height * 0.12281 + 0.5)), cornerRadius: 6)
        background.setFill()
        rectangle9Path.fill()


        //// Star 2 Drawing
        var star2Path = UIBezierPath()
        star2Path.moveToPoint(CGPointMake(interestField.minX + 0.10766 * interestField.width, interestField.minY + 0.24561 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.12633 * interestField.width, interestField.minY + 0.37652 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.15799 * interestField.width, interestField.minY + 0.42139 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.13786 * interestField.width, interestField.minY + 0.54717 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.13877 * interestField.width, interestField.minY + 0.70580 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.10766 * interestField.width, interestField.minY + 0.65263 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.07656 * interestField.width, interestField.minY + 0.70580 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.07747 * interestField.width, interestField.minY + 0.54717 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.05733 * interestField.width, interestField.minY + 0.42139 * interestField.height))
        star2Path.addLineToPoint(CGPointMake(interestField.minX + 0.08900 * interestField.width, interestField.minY + 0.37652 * interestField.height))
        star2Path.closePath()
        UIColor.whiteColor().setFill()
        star2Path.fill()
    }

